import React from 'react';

import PlayersList from '../components/PlayersList';
import './Players.css';

const Players = () => {
  const MOCK_PLAYERS = [
    {
      id: 'p1',
      Name: 'Novak Djokovic',
      Country: 'Serbia',
      Age: 33,
      Grand_Slams: 17,
      Ranking: 1,
      Points: 12030,
    },
    {
      id: 'p2',
      Name: 'Rafael Nadal',
      Country: 'Spain',
      Age: 34,
      Grand_Slams: 20,
      Ranking: 2,
      Points: 9850,
    },
    {
      id: 'p3',
      Name: 'Roger Federer',
      Country: 'Switzerland',
      Age: 39,
      Grand_Slams: 20,
      Ranking: 3,
      Points: 6630,
    },
  ];

  return <PlayersList items={MOCK_PLAYERS} />;
};

export default Players;
